  <![if !mso]>
  <table cellpadding=0 cellspacing=0 width="100%">
   <tr>
    <td><![endif]>
    <div>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Congenial Light"'>Interactividad: Permite la interacción del
    usuario mediante interfaces, botones, menús y otros elementos. <o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Congenial Light"'>Multimedia: Combina texto, imágenes, video, animación
    y sonido para enriquecer la experiencia visual.<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Congenial Light"'>Flexibilidad y Adaptación: Se adapta a
    diferentes dispositivos y tamaños de pantalla mediante el diseño
    responsivo.<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Congenial Light"'>Dinámico y Actualizable: Los contenidos
    pueden actualizarse en tiempo real, como en sitios web y plataformas en
    línea.<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Congenial Light"'>Usabilidad y Experiencia de Usuario (UX): Se
    enfoca en crear interfaces intuitivas y agradables para el usuario final.<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Congenial Light"'>Alta Resolución y Calidad Visual: Utiliza
    gráficos de alta definición para garantizar calidad en pantallas modernas.<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Congenial Light"'>Optimización: Se considera el rendimiento y
    la carga rápida, especialmente en plataformas web y móviles.<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Congenial Light"'><o:p>&nbsp;</o:p></span></p>
    </div>
    <![if !mso]></td>
   </tr>
  </table>
  <![endif]></v:textbox>
